import logo from './logo.svg';
import './App.css';
import {useState} from 'react';

const pieces = [1, 2, 3, 4, 5, 6, 7, 8, 9];

function App() {
  return (
    <>
      <div>
        <table>
          <tr>
            <td key="1">1</td>
            <td key="2">2</td>
            <td key="3">3</td>
          </tr>
          <tr>
            <td key="4">4</td>
            <td key="5">5</td>
            <td key="6">6</td>
          </tr>
          <tr>
            <td key="7">7</td>
            <td key="8">8</td>
            <td key="9">9</td>
          </tr>
      </table>
      <div>
        {pieces.map((piece) => {
          return <article>{piece}</article>
        })}
      </div>
      </div>
    </>
  );
}

export default App;
